import React from 'react'
import { Col, Input} from 'antd';




class TextFieldComp extends React.Component {
    render() {
        const {myProp} = this.props;
        //placeholder and label

        return (
            <Col span = {4}>
                Form
            </Col>
        )
    }
}

export default TextFieldComp
